              '@import "function";\n@import "../common/var";\n\n/* Break-points\n -------------------------- */\n@mixin res($key, $map: $--breakpoints) {\n  // 循环断点Map，如果存在则返回\n  @if map-has-key($map, $key) {\n    @media only screen and #{inspect(map-get($map, $key))} {\n      @content;\n    }\n  } @else {\n    @warn "Undefeined points: `#{$map}`";\n  }\n}\n\n/* Scrollbar\n -------------------------- */\n@mixin scroll-bar {\n  $--scrollbar-thumb-background: #b4bccc;\n  $--scrollbar-track-background: #fff;\n\n  &::-webkit-scrollbar {\n    z-index: 11;\n    width: 6px;\n\n    &:horizontal {\n      height: 6px;\n    }\n\n    &-thumb {\n      border-radius: 5px;\n      width: 6px;\n      background: $--scrollbar-thumb-background;\n    }\n\n    &-corner {\n      background: $--scrollbar-track-background;\n    }\n\n    &-track {\n      background: $--scrollbar-track-background;\n\n      &-piece {\n        background: $--scrollbar-track-background;\n        width: 6px;\n      }\n    }\n  }\n}\n\n/* Placeholder\n -------------------------- */\n@mixin placeholder {\n  &::-webkit-input-placeholder {\n    @content\n  }\n\n  &::-moz-placeholder {\n    @content\n  }\n\n  &:-ms-input-placeholder {\n    @content\n  }\n}\n\n/* BEM\n -------------------------- */\n@mixin b($block) {\n  $B: $namespace+\'-\'+$block !global;\n\n  .#{$B} {\n    @content;\n  }\n}\n\n@mixin e($element) {\n  $E: $element !global;\n  $selector: &;\n  $currentSelector: "";\n  @each $unit in $element {\n    $currentSelector: #{$currentSelector + "." + $B + $element-separator + $unit + ","};\n  }\n\n  @if hitAllSpecialNestRule($selector) {\n    @at-root {\n      #{$selector} {\n        #{$currentSelector} {\n          @content;\n        }\n      }\n    }\n  } @else {\n    @at-root {\n      #{$currentSelector} {\n        @content;\n      }\n    }\n  }\n}\n\n@mixin m($modifier) {\n  $selector: &;\n  $currentSelector: "";\n  @each $unit in $modifier {\n    $currentSelector: #{$currentSelector + & + $modifier-separator + $unit + ","};\n  }\n\n  @at-root {\n    #{$currentSelector} {\n      @content;\n    }\n  }\n}\n\n@mixin configurable-m($modifier, $E-flag: false) {\n  $selector: &;\n  $interpolation: \'\';\n\n  @if $E-flag {\n    $interpolation: $element-separator + $E-flag;\n  }\n\n  @at-root {\n    #{$selector} {\n      .#{$B+$interpolation+$modifier-separator+$modifier} {\n        @content;\n      }\n    }\n  }\n}\n\n@mixin spec-selector($specSelector: \'\', $element: $E, $modifier: false, $block: $B) {\n  $modifierCombo: \'\';\n\n  @if $modifier {\n    $modifierCombo: $modifier-separator + $modifier;\n  }\n\n  @at-root {\n    #{&}#{$specSelector}.#{$block+$element-separator+$element+$modifierCombo} {\n      @content\n    }\n  }\n}\n\n@mixin meb($modifier: false, $element: $E, $block: $B) {\n  $selector: &;\n  $modifierCombo: \'\';\n\n  @if $modifier {\n    $modifierCombo: $modifier-separator + $modifier;\n  }\n\n  @at-root {\n    #{$selector} {\n      .#{$block+$element-separator+$element+$modifierCombo} {\n        @content\n      }\n    }\n  }\n}\n\n@mixin when($state) {\n  @at-root {\n    &.#{$state-prefix + $state} {\n      @content;\n    }\n  }\n}\n\n@mixin extend-rule($name) {\n  @extend #{\'%shared-\'+$name};\n}\n\n@mixin share-rule($name) {\n  $rule-name: \'%shared-\'+$name;\n\n  @at-root #{$rule-name} {\n    @content\n  }\n}\n\n@mixin pseudo($pseudo) {\n  @at-root #{&}#{\':#{$pseudo}\'} {\n    @content\n  }\n}\n\n',
              '@import "mixins/mixins";\n@import "common/var";\n@import "./popper";\n\n@include b(select-dropdown) {\n  position: absolute;\n  z-index: #{$--index-top + 1};\n  border: $--select-dropdown-border;\n  border-radius: $--border-radius-base;\n  background-color: $--select-dropdown-background;\n  box-shadow: $--select-dropdown-shadow;\n  box-sizing: border-box;\n  margin: 5px 0;\n\n  @include when(multiple) {\n    & .el-select-dropdown__item {\n      padding-right: 40px;\n    }\n    & .el-select-dropdown__item.selected {\n      color: $--select-option-selected-font-color;\n      background-color: $--select-dropdown-background;\n\n      &.hover {\n        background-color: $--select-option-hover-background;\n      }\n\n      &::after {\n        position: absolute;\n        right: 20px;\n        font-family: \'element-icons\';\n        content: "\\e6da";\n        font-size: 12px;\n        font-weight: bold;\n        -webkit-font-smoothing: antialiased;\n        -moz-osx-font-smoothing: grayscale;\n      }\n    }\n  }\n\n  .el-scrollbar.is-empty .el-select-dropdown__list{\n    padding: 0;\n  }\n}\n\n@include b(select-dropdown__empty) {\n  padding: $--select-dropdown-empty-padding;\n  margin: 0;\n  text-align: center;\n  color: $--select-dropdown-empty-color;\n  font-size: $--select-font-size;\n}\n\n@include b(select-dropdown__wrap) {\n  max-height: $--select-dropdown-max-height;\n}\n\n@include b(select-dropdown__list) {\n  list-style: none;\n  padding: $--select-dropdown-padding;\n  margin: 0;\n  box-sizing: border-box;\n}\n',
              "$color-primary: #7db82c;\n\n@mixin flex($align: '', $justify: '', $direction: '') {\n  display: flex;\n\n  @if $direction == '' {\n    flex-direction: row;\n  } @else {\n    flex-direction: $direction;\n  }\n  @if $align == '' {\n    align-items: center;\n  } @else {\n    align-items: $align;\n  }\n  @if $justify == '' {\n    justify-content: center;\n  } @else {\n    justify-content: $justify;\n  }\n}\n\n@mixin page($direction: row, $color: #f6f7fc) {\n  width: 100%;\n  height: 100%;\n  background-color: $color;\n  @include flex('', '', $direction);\n}\n",
